import React from 'react';

const Header = () => {
    return (
        <div className= "header">
              <div className="header_logo">
                <img src="./image/lfwf-default-logo.png" alt="" />  
                </div>   
                <div className="header_nav">
                    <nav></nav>    
                </div>       
        </div>
    );
};

export default Header;
